import { useState } from 'react'
import styled from '@emotion/styled/macro'

const AddTodoForm = styled.form`
    margin: 3px;
    button {
        margin-right: 5px;
    }
`

function BuyProduct() {
    const [ text, setText ] = useState("")

    return (
        <AddTodoForm onSubmit={(e) => {
            e.preventDefault()
            console.log("Buying ", text)
            setText("")
        }}>
            <button>+</button>
            <input type="number" value={text} min="0" onChange={(e) => setText(e.target.value)} />
        </AddTodoForm>
    )
}

export default BuyProduct
